import React from 'react'
//import { StyleSheet, Text,Modal, View,TouchableOpacity } from 'react-native'
import { AntDesign, Ionicons } from '@expo/vector-icons';
import axios from "axios";
import { Alert, Modal, StyleSheet, TouchableOpacity, TextInput, Text, TouchableHighlight, View } from 'react-native';
import { Entypo } from '@expo/vector-icons';
import * as DocumentPicker from 'expo-document-picker';
//import { TextInput } from 'react-native-gesture-handler';

const Home = ({navigation}) => {
  const [modalVisible, setModalVisible] = React.useState(false);
  const [file, setFile] = React.useState();
  const [name, setName] = React.useState();
  async function handleSend() {
    const data = {
    
      name: name,
      file:file.uri
    }
    // const reader = new FileReader();
    // reader.readAsDataURL(file);
    // reader.onloadend = () => {
    //   data.fname = reader.result;
    // }
    console.log(data)

    await axios.post("https://localhost:3006/api/upload", data).then((res) => {
      console.log(res.data)
    }).catch((err) => {
      console.log(err)
    })
    }
    
    async function select() {
        let result = await DocumentPicker.getDocumentAsync({ type: "application/pdf" });
        
      setFile(result);
        
    console.log(result.data);
    if (!result.cancelled) {
        console.log(result)
      
    } else {
        alert("no")
      }
    }
    return (
      
        <View style={styles.centeredView}>
      <Modal
        animationType="slide"
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => {
          Alert.alert('Modal has been closed.');
        }}>
        <View style={styles.centeredView}>
          <View style={styles.modalView}>
                        <View>
                            <TextInput onChange={e=>setName(e.target.value)} style={{width:200,marginTop:50, borderBottomWidth: 1,
              borderColor: "black"}} placeholder="filename"/>
            <TouchableOpacity style={{margin:"5%", marginLeft:"25%",marginTop:40}} onPress={()=>select()}>
            <AntDesign name="addfile" size={24} color="black" />
                </TouchableOpacity>
        </View>
<View style={{display:"flex",flexDirection:"row-reverse", justifyContent:"space-between", width:150,marginTop:30}}>
            <TouchableHighlight
              style={{ }}
              onPress={() =>handleSend()}>
                            
                            <Ionicons name="md-checkmark" size={32} color="green" />
                          
                        </TouchableHighlight>
                        <TouchableHighlight
              style={{ }}
              onPress={() => {
                setModalVisible(!modalVisible);
                            }}>
                            
                            <Entypo name="cross" size={32} color="red" />
                          
                            </TouchableHighlight>
                            </View>
                        
          </View>
        </View>
      </Modal>

      <TouchableHighlight
     
        onPress={() => {
          setModalVisible(true);
        }}>
       <AntDesign name="addfile" size={54} color="black" />
      </TouchableHighlight>
    </View>
    )
}

export default Home

const styles = StyleSheet.create({centeredView: {
    flex: 1,

    justifyContent: 'center',
    alignItems: 'center',
    marginTop: 22,
  },
  modalView: {
      margin: 20,
      width: "80%",
      height:"30%",
    backgroundColor: 'white',
    borderRadius: 20,
    padding: 5,
    alignItems: 'center',
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
  openButton: {
    backgroundColor: '#F194FF',
    borderRadius: 20,
    padding: 10,
    elevation: 2,
  },
  textStyle: {
    color: 'white',
    fontWeight: 'bold',
    textAlign: 'center',
  },
  modalText: {
    marginBottom: 15,
    textAlign: 'center',
  },
});
